    useEffect(() => {
        if(episodes) {
            const dupa = episodes.items.map(episode => {
                return <audio src={episode.audio_preview_url}/>
            });
            console.log(dupa);
            console.log('XDDD!!!');
        }
    }, []);

    return (
        <Fragment>
            <header>
                <img src={image} alt="" />
                <h2>{name}</h2>
                <Description>{description}</Description>
            </header>
            <div>

            </div>
        </Fragment>
    );
}

export default ShowDetailsContent;
